import React from "react";
import {
  AppBar, Toolbar, Typography, Box, Avatar, IconButton, Menu, MenuItem, Card, Divider, Button, List, ListItem, ListItemIcon, ListItemText, Drawer, Badge, Fab
} from "@mui/material";
import PersonIcon from "@mui/icons-material/Person";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import EditIcon from "@mui/icons-material/Edit";
import PhoneIphoneIcon from "@mui/icons-material/PhoneIphone";
import EmailIcon from "@mui/icons-material/Email";
import VpnKeyIcon from "@mui/icons-material/VpnKey";
import LogoutIcon from "@mui/icons-material/Logout";
import QueryBuilderIcon from "@mui/icons-material/QueryBuilder";
import WalletIcon from "@mui/icons-material/AccountBalanceWallet";
import ListAltIcon from "@mui/icons-material/ListAlt";
import MenuOpenIcon from "@mui/icons-material/MenuOpen";
import HelpOutlineIcon from "@mui/icons-material/HelpOutline";
import LocationOnIcon from "@mui/icons-material/LocationOn";
import AssignmentIcon from "@mui/icons-material/Assignment";
import CloseIcon from "@mui/icons-material/Close";

const navDropdowns = [
  {label: "Masters", items: ["Vehicle Master", "Product Master"]},
  {label: "Order", items: ["Place an Order", "My Cart", "My Orders"]},
  {label: "Reports", items: ["Order History", "Wallet Reports"]},
  {label: "Integration", items: ["API Keys", "Webhook", "Partner Integration"]},
  {label: "Support", items: ["Help Center", "Contact Support"]},
];
const navDirect = [
  {label: "Home", link: "#"},
  {label: "Learning", link: "#"},
];

export default function ZomatoProDashboard() {
  const [profileOpen, setProfileOpen] = React.useState(false);
  const [navAnchor, setNavAnchor] = React.useState(null);
  const [dropdownIdx, setDropdownIdx] = React.useState(-1);

  const handleDropdownOpen = (idx, event) => {
    setDropdownIdx(idx);
    setNavAnchor(event.currentTarget);
  };
  const handleDropdownClose = () => {
    setDropdownIdx(-1);
    setNavAnchor(null);
  };

  return (
    <Box>
      {/* NAVBAR */}
      <AppBar position="sticky" className="zmt-appbar">
        <Toolbar disableGutters className="zmt-appbar-inner">
          <Box display="flex" alignItems="center">
            <Avatar sx={{width: 42, height: 42, bgcolor: "#fff", color: "#e23744", fontWeight: 900}}>
              <PersonIcon fontSize="medium" />
            </Avatar>
            <span className="zmt-logo-txt">FUELnow</span>
          </Box>
          <Box className="zmt-navlinks">
            {navDirect.map(el => (
              <Button className="zmt-nav-btn" sx={{mr:1}} key={el.label}>{el.label}</Button>
            ))}
            {navDropdowns.map((el, idx) => (
              <Box key={el.label} sx={{position:"relative"}}>
                <Button className="zmt-drop-btn"
                  aria-controls={`nav-dropdown-${idx}`}
                  aria-haspopup="true"
                  onMouseEnter={e => handleDropdownOpen(idx,e)}
                  onMouseLeave={handleDropdownClose}
                >
                  {el.label}
                  <span style={{marginLeft:6,fontWeight:400,fontSize:15}}>▼</span>
                </Button>
                <Menu
                  id={`nav-dropdown-${idx}`}
                  anchorEl={navAnchor}
                  open={dropdownIdx === idx}
                  onClose={handleDropdownClose}
                  MenuListProps={{onMouseLeave: handleDropdownClose}}
                >
                  {el.items.map(i =>
                    <MenuItem key={i} onClick={handleDropdownClose}>{i}</MenuItem>
                  )}
                </Menu>
              </Box>
            ))}
            {/* Cart */}
            <IconButton size="large" className="zmt-cart-btn">
              <Badge badgeContent={1} color="error">
                <ShoppingCartIcon sx={{ fontSize: 25 }} />
              </Badge>
            </IconButton>
            {/* Profile */}
            <Avatar
              className="zmt-profile-av"
              sx={{
                width: 40, height: 40,
                bgcolor: "#ffd1d1", color: "#b71c1c",
                fontWeight: 700, fontSize: 25, ml: 0.5
              }}
              onClick={() => setProfileOpen(true)}>
              J
            </Avatar>
          </Box>
        </Toolbar>
      </AppBar>

      {/* GREETING BANNER */}
      <div className="zmt-welcome-badge">Hello, Jai Devarajan</div>

      {/* DASHBOARD BODY */}
      <div className="zmt-dashboard-wrapper">
        <div className="zmt-cards-grid">
          <Card className="zmt-card loyalty">
            <span className="zmt-card-title">Available Loyalty</span>
            <span className="amt">₹0</span>
            <span className="desc">Available Loyalty - Blocked (In Cart, Payment Initiated)</span>
            <span className="zmt-card-icon"><QueryBuilderIcon sx={{fontSize: 34}} /></span>
          </Card>
          <Card className="zmt-card wallet">
            <span className="zmt-card-title">My Wallet Limit</span>
            <span className="amt">₹0</span>
            <span className="desc">Amount available in your wallet</span>
            <span className="zmt-card-icon"><WalletIcon sx={{fontSize:34}} /></span>
          </Card>
          <Card className="zmt-card orders">
            <span className="zmt-card-title" style={{color:"#111"}}>My Last 5 Orders</span>
            <Divider sx={{my: 1.2,opacity:.75}}/>
            <span className="desc">No records found</span>
            <span className="zmt-card-icon"><ListAltIcon sx={{fontSize:34,color:"#e23744",opacity:.32}}/></span>
          </Card>
        </div>
        <div className="zmt-assets-section">
          <div className="zmt-assets-header">
            <span className="zmt-assets-title">My Assets</span>
            <Button className="zmt-assets-more-btn">More</Button>
          </div>
          <Divider sx={{my: 1}}/>
          <div className="zmt-empty-block">No records found</div>
        </div>
      </div>

      {/* FLOATING ACTION BUTTONS */}
      <div className="zmt-floating-actions">
        <Fab className="zmt-fab-btn" title="Help"><HelpOutlineIcon fontSize="inherit" /></Fab>
        <Fab className="zmt-fab-btn" title="Location"><LocationOnIcon fontSize="inherit" /></Fab>
        <Fab className="zmt-fab-btn" title="Orders"><AssignmentIcon fontSize="inherit" /></Fab>
        <Fab className="zmt-fab-btn" title="Cart"><ShoppingCartIcon fontSize="inherit" /></Fab>
      </div>

      {/* PROFILE DRAWER */}
      <Drawer
        anchor="right"
        open={profileOpen}
        onClose={()=>setProfileOpen(false)}
        className="zmt-profile-drawer"
      >
        <Box className="drawer-profile-header" display="flex" flexDirection="column">
          <IconButton sx={{ alignSelf: "flex-end", mt: 0.5, mb:.5, mr: .5 }} onClick={()=>setProfileOpen(false)}><CloseIcon fontSize="large" /></IconButton>
          <Avatar className="drawer-profile-av" sx={{
            width: 86, height: 86, bgcolor: "#ffd1d1", color: "#b71c1c",
            fontWeight: 900, fontSize: 41, mb: 0.8, mt: -2
          }}>
            J
          </Avatar>
          <span className="drawer-profile-name">jai devarajan</span>
          <Button startIcon={<EditIcon/>} className="drawer-profile-edit-btn" variant="contained">
            Edit Profile
          </Button>
        </Box>
        <Divider />
        <List>
          <ListItem button><ListItemIcon><PhoneIphoneIcon sx={{color:"#e23744"}} /></ListItemIcon><ListItemText primary="Update Mobile" /></ListItem>
          <ListItem button><ListItemIcon><EmailIcon sx={{color:"#e23744"}}/></ListItemIcon><ListItemText primary="Update Email" /></ListItem>
          <ListItem button><ListItemIcon><VpnKeyIcon sx={{color:"#e23744"}} /></ListItemIcon><ListItemText primary="Update Password" /></ListItem>
          <ListItem button><ListItemIcon><LogoutIcon sx={{color:"#e23744"}} /></ListItemIcon><ListItemText primary="Log Out" /></ListItem>
        </List>
      </Drawer>

      {/* FOOTER */}
      <div className="zmt-footer">
        Home | About Us | Contact Us | Privacy Policy | Legal Notice | Services | Become a Partner
      </div>
    </Box>
  );
}
